import Layout from "./components/Layout/Layout";
import './App.css';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <Router>
    <div>
      <Switch>
      <Route path="/app" exact component={Layout}></Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
